para solicitar acesso ao CRM Voiza, indicamos a seguinte sequência de passos:
- O beneficiado deve entrar no portal gestão de identidades (https://portalgestaodeidentidade.br.wal-mart.com/idm/walmart/);
- Clicar em Meu menu -> Acessos -> Solicitar Acesso;
- Clicar na aba Perfis;
- Clicar no botão Adicionar Perfil;
- Procurar um perfil referente ao sistema Voiza;
- Selecionar o perfil desejado.
Nesse momento, a solicitação será enviada ao gestor, aguardando sua aprovação.

